import React, {Component} from 'react';

class Login extends Component {
  render() {
    return (
      <div className="container">
        <div className="row">
          <div className="jumbotron col-12">
            <h1 className="display-3">Welcome, {localStorage.getItem('token')}!</h1>
          </div>
        </div>
      </div>
    );
  }
}

export default Profile;
